import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './Header';
import Search from './Search';
import Results from './Results';
class App extends Component {

  componentDidMount() {
    const script = document.createElement("script");
    script.async = true;
    script.src = "//maxcdn.bootstrapcdn.com/bootstrap/4.1.1/js/bootstrap.min.js";
    document.head.appendChild(script);
  }


  constructor() {
    super();
    this.state = {
        searchRessults:['movie1','movie2','movie3']
    };
  }

  addData(){
    this.setState({searchRessults: this.state.searchRessults.reverse()})

  }

  render() {
    // const myName = "sammy";
    return (
      <div className="App">
        <Header headerText="Youtube Search" />
        <Search />
        <button type="button" class="btn btn-primary btn-sm" onClick={this.addData.bind(this)}>Small button</button>
        <Results search={this.state.searchRessults}/>
      </div>

    );
  }
}




export default App;
